using System;
using HtmlAgilityPack;
using System.Data;

public static class Snippet
{
	public static void func(System.Data.DataTable participateTbl, System.String filePath)
	{
		var doc = new HtmlAgilityPack.HtmlDocument();

            doc.Load(filePath);
		    //Go Over Rows
            foreach (HtmlNode row in doc.DocumentNode.SelectNodes("//table/tr"))
            {
				//Load all headers
                HtmlNodeCollection headers = row.SelectNodes("th");
				//Load all lines
                HtmlNodeCollection cells = row.SelectNodes("td");
				//Go over Comsign Sign Fiels by participate type
                for (int participateTypeCounter = 0; participateTypeCounter < participateTbl.Rows.Count; participateTypeCounter++)
                {
                    if (headers != null)
                    {

                        headers.Append(HtmlNode.CreateNode("<th>"+participateTbl.Rows[participateTypeCounter][0]+"</th>"));
                        row.RemoveAllChildren();
                        row.AppendChildren(headers);
                    }
                    else
                    {
                        cells.Append(HtmlNode.CreateNode("<td>"+participateTbl.Rows[participateTypeCounter][1]+"</td>"));
                        row.RemoveAllChildren();
                        row.AppendChildren(cells);
                    }
                 }

                }

            doc.Save(filePath);

	}

}

using System;
using System.Data;

public static class Snippet
{
	public static void func(ref System.Data.DataTable DT_FieldsToSign)
	{

		DataColumn column;


		column = new DataColumn();
		column.DataType = Type.GetType("System.String");
		column.ColumnName = "MergeFieldName";
		DT_FieldsToSign.Columns.Add(column);

		column = new DataColumn();
		column.DataType = Type.GetType("System.String");
		column.ColumnName = "TagTemplate";
		DT_FieldsToSign.Columns.Add(column);

		column = new DataColumn();
		column.DataType = Type.GetType("System.String");
		column.ColumnName = "MergeFieldDescription";
		DT_FieldsToSign.Columns.Add(column);

	}

}
